package club.p6e.live.room.platform.douyin;

import club.p6e.live.room.LiveRoomCodec;
import club.p6e.live.room.utils.Utils;
import io.netty.buffer.ByteBuf;
import io.netty.buffer.Unpooled;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;

import java.io.*;
import java.nio.charset.StandardCharsets;
import java.util.*;

/**
 * @author lidashuang
 * @version 1.0
 */
public class Codec extends LiveRoomCodec<Message> {

    private static final int MARK = 48;
    /** 日志对象 */
    private static final Logger LOGGER = LoggerFactory.getLogger(Codec.class);

    public Codec(MessageBuilder builder) {
        super(builder);
    }

    @Override
    @SuppressWarnings("all")
    public List<Message> decode(ByteBuf byteBuf) {
        // 解码的内容长度
        LOGGER.debug("[ DouYin ] decode content length ==> " + byteBuf.readableBytes());
        // 解码且将返回的对象添加到管道中
        final List<Message> messages = new ArrayList<>();
        final Map<Integer, Object> map = decodeByteBufToMessage(byteBuf);
        // 拆分消息
        if (map.size() >= 1 && map.get(0) instanceof List) {
            final List<Object> list = (List<Object>) map.get(0);
            final Map<Integer, Object> extend = new HashMap<>(4);
            extend.put(2, map.get(2));
            extend.put(3, map.get(3));
            extend.put(4, map.get(4));
            extend.put(5, map.get(5));
            for (final Object o : list) {
                final Message message = new Message();
                if (o instanceof Map) {
                    final Map<Integer, Object> om = (Map<Integer, Object>) o;
                    message.setData(om.get(2));
                    if (om.get(1) != null) {
                        message.setType(String.valueOf(om.get(1)));
                    }
                    if (om.get(3) != null) {
                        message.setId(String.valueOf(om.get(3)));
                    }
                } else {
                    message.setData(map);
                }
                message.setExtend(extend);
                messages.add(message);
            }
        } else {
            final Message message = new Message();
            message.setData(map);
            messages.add(message);
        }
        System.out.println(messages.size());
        return messages;
    }

    @Override
    public ByteBuf encode(Message message) {
        // 抖音特殊不需要编码
        return null;
    }

    public static void main(String[] args) {

        File file = new File("./1.txt");
        BufferedReader reader = null;
        // ByteArrayOutputStream os = new ByteArrayOutputStream();
        final ByteBuf byteBuf = Unpooled.buffer();
        try {
            reader = new BufferedReader(new FileReader(file));
            int b1;
            int b2;
            while (((b1 = reader.read()) != -1) && ((b2 = reader.read()) != -1)) {
                System.out.print(b1 + b2);
                byteBuf.writeBytes(Utils.hexToByte(new String(new byte[] { (byte) b1, (byte) b2 })));
            }
            System.out.println();
            reader.close();
        } catch (IOException e) {
            e.printStackTrace();
        } finally {
            if (reader != null) {
                try {
                    reader.close();
                } catch (IOException e1) {
                    e1.printStackTrace();
                }
            }
        }

// 
// 
        System.out.println(
                decodeByteBufToMessage(byteBuf)
        );

    }

    @SuppressWarnings("all")
    private static Map<Integer, Object> decodeByteBufToMessage(ByteBuf byteBuf) {
        final Map<Integer, Object> result = new HashMap<>(16);
        while (true) {
            final int[] tt = getTagAndType(byteBuf);
            if (tt == null) {
                break;
            }
            switch (tt[1]) {
                case 0:
                    Object o1 = getType0(byteBuf);
                    result.put(tt[0], o1);
                    break;
                case 1:
                    Object o2 = getType1(byteBuf);
                    result.put(tt[0], o2);
                    break;
                case 2:
                    final ByteBuf buf = getType2(byteBuf);
                    try {
                        if (buf == null) {
                            mapWriteData(result, tt[0], "");
                        } else if (buf.readableBytes() == 1) {
                            mapWriteData(result, tt[0], Utils.bytesToHex(buf.array()));
                        } else {
                            final int[] tt2 = getTagAndType(buf);
                            buf.resetReaderIndex();
                            if (tt2 == null) {
                                mapWriteData(result, tt[0], buf.toString(StandardCharsets.UTF_8));
                            } else {
                                if ((tt2[0] == 1 && (tt2[1] == 0 || tt2[1] == 1 || tt2[1] == 2))
                                        || (tt2[0] == 4 && tt2[1] == 2)
                                        || ((tt[0] == 2 || tt[0] == 21) && tt2[0] == 2 && tt2[1] == 2)) {
                                    mapWriteData(result, tt[0], decodeByteBufToMessage(buf));
                                } else {
                                    final int mark = buf.readByte();
                                    buf.resetReaderIndex();
                                    if (MARK == mark) {
                                        final Object o = tsFun(buf);
                                        if (o == null) {
                                            mapWriteData(result, tt[0], buf.toString(StandardCharsets.UTF_8));
                                        } else {
                                            mapWriteData(result, tt[0], o);
                                        }
                                    } else {
                                        mapWriteData(result, tt[0], buf.toString(StandardCharsets.UTF_8));
                                    }
                                }
                            }
                        }
                    } finally {
                        if (buf != null) {
                            buf.release();
                        }
                    }
                    break;
                default:
                    final byte[] readBytes = new byte[byteBuf.readerIndex()];
                    byteBuf.readBytes(readBytes);
                    throw new RuntimeException("decodeByteBufToMessages type is null." + Utils.bytesToHex(readBytes) + "  \n\n " + result);
            }
        }
        return result;
    }

    /**
     * 3038 3233 5f 6c 69 79 61 6f 79 61 6f
     * 写入数据
     * @param m
     * @param a
     * @param b
     */
    @SuppressWarnings("all")
    private static void mapWriteData(Map<Integer, Object> m, Integer a, Object b) {
        if (m.get(a) == null) {
            m.put(a, b);
        } else {
            if (m.get(a) instanceof List) {
                ((List) m.get(a)).add(b);
            } else {
                List list = new ArrayList();
                list.add(b);
                m.put(a, list);
            }
        }
    }

    private static int[] getTagAndType(ByteBuf byteBuf) {
        long data;
        try {
            data = getType0(byteBuf);
        } catch (Exception e) {
            return null;
        }
        if (data < 0) {
            return null;
        }
        return new int[] { (int) data >> 3, (int) data & 0x07 };
    }

    private static long getType0(ByteBuf byteBuf) {
        final StringBuilder sb = new StringBuilder();
        while (true) {
            if (byteBuf.isReadable()) {
                String ls = "00000000" + Integer.toBinaryString(byteBuf.readByte());
                ls = ls.substring(ls.length() - 8);
                sb.insert(0, ls.substring(1));
                if (ls.startsWith("0")) {
                    break;
                }
            } else {
                return -1;
            }
        }
        if (sb.toString().length() > 64) {
            return -1;
        } else {
            return Long.parseLong(sb.toString(), 2);
        }
    }

    private static double getType1(ByteBuf byteBuf) {
        return byteBuf.readDouble();
    }

    private static ByteBuf getType2(ByteBuf byteBuf) {
        final long len = getType0(byteBuf);
        if (len > 0) {
            final ByteBuf buf = Unpooled.buffer((int) len);
            byteBuf.readBytes(buf);
            return buf;
        } else {
            return null;
        }
    }

    private static Map<Integer, Object> tsFun(ByteBuf byteBuf) {
        final Map<Integer, Object> result = new HashMap<>(16);
        byteBuf.readByte();
        result.put(0, byteBuf.readByte());
        while (byteBuf.isReadable()) {
            final int key = (int) getType0(byteBuf);
            final int length = (int) getType0(byteBuf);
            if (key == -1 || length == -1 || length > byteBuf.readableBytes()) {
                return null;
            }
            final ByteBuf buf = Unpooled.buffer(length);
            try {
                byteBuf.readBytes(buf);
                result.put(key, decodeByteBufToMessage(buf));
            } finally {
                buf.release();
            }
        }
        return result;
    }
}


